/* eslint-disable @typescript-eslint/no-unused-vars */
import './App.css';

function App() {
  const name:string = 'Benevanio';
  // eslint-disable-next-line @typescript-eslint/no-unused-vars
  interface User{
    name:string;
    age:number;
    id:string;

  }
  const user:User = {
    name: 'Benevanio',
    age: 30,
    id: '1'
  }
  return (
    <div className="App">
      <header className="App-header">

        <nav>
          <a href="#">Home</a>
          <a href="#">About</a>
          <a href="#">Contact</a>

        </nav>
        </header>

        <h1>Usuario Sistema: {user.name}</h1>
        <h1>Sua idade é: {user.age}</h1>
        <h1>Seu ID é: {user.id}</h1>

      </div>


  );
}

export default App;
